import React, {Component} from 'react'; //Mayuscula minuscula

function Navegacion(){
    return(
    <div className="container">
        <nav className="nav navbar navbar-dark bg-dark">
            <a className="nav-link active" href="#">{this.props.titulo}}</a>
            <a className="nav-link" href="#">Link</a>
            <a className="nav-link disabled" href="#">Disabled link</a>
        </nav>
    </div>
    );
}

export default Navegacion;
